                                                <input class="form-control" id="minprice" placeholder="Min Price">
                                                </input>

                                            </div>
                                        </div>

                                        <div class="col-12 col-md-4 col-xl-3">
                                            <div class="form-group">
                                                <input class="form-control" id="maxprice" placeholder="Max Price">
                                                </input>

                                            </div>
                                        </div>

                                        <div class="col-12 col-md-4 col-xl-2">
                                            <div class="form-group">
                                                <select class="form-control" id="bhk">
                                                    <option>BHK</option>
                                                    <option>1BHK</option>
                                                    <option>2BHK</option>
                                                    <option>3BHK</option>
                                                    <option>4BHK</option>
                                                    <option>5BHK</option>
                                                </select>
                                            </div>
                                        </div> */}

                                        {/* Buy/Rent Select */}
                                        <div className="col-12 col-md-4 col-lg-3">
                                            <div className="form-group">
                                                <select
                                                    className="form-control"
                                                    id="BuyRent"
                                                    value={selectedBuyRent}
                                                    onChange={handleBuyRentChange}
                                                >
                                                    <option value="Buy">Buy</option>
                                                    <option value="Rent">Rent</option>
                                                </select>
                                            </div>
                                        </div>


                                        {/* Cities Select */}
                                        <div className="col-12 col-md-4 col-lg-3">
                                            <div className="form-group">
                                                <select
                                                    className="form-control"
                                                    id="cities"
                                                    value={selectedCity}
                                                    onChange={(e) => setSelectedCity(e.target.value)}
                                                >
                                                    <option>All Cities</option>
                                                    <option>Ahmedabad</option>
                                                    <option>Surat</option>
                                                    <option>Vadodara</option>
                                                    <option>Rajkot</option>
                                                    <option>Rajkot</option>
                                                    <option>Gandhinagar</option>
                                                    <option>Bhavnagar</option>
                                                    <option>Jamnagar</option>
                                                    <option>Junagadh</option>
                                                    <option>Anand</option>
                                                    <option>Nadiad</option>
                                                    <option>Mehsana</option>
                                                    <option>Morbi</option>
                                                    <option>Surendranagar</option>
                                                    <option>Valsad</option>
                                                    <option>Bharuch</option>
                                                    <option>Navsari</option>
                                                    <option>Dahod</option>
                                                    <option>Patan</option>
                                                    <option>Palanpur</option>
                                                    <option>Porbandar</option>
                                                </select>
                                            </div>
                                        </div>

                                        {/* Cities Select */}
                                        {/* <div className="col-12 col-md-4 col-lg-3">
                                            <div className="form-group">
                                                <select className="form-control" id="cities">
                                                    <option>All Cities</option>
                                                    <option>Ahmedabad</option>
                                                    <option>Surat</option>
                                                    <option>Vadodara</option>
                                                    <option>Rajkot</option>
